import api from '../axios'; // or wherever your axios.js file is

const placeOrder = async () => {
  try {
    const res = await api.post('/orders', {
      serviceId,
      quantity,
      address,
      pickupDate,
    });
    console.log('✅ Order success:', res.data);
  } catch (err) {
    console.error('❌ Order failed:', err.response?.data || err.message);
  }
};
